config.script:
data = self.parent.parent.getChild("Table").props.data
csv = system.dataset.toCSV(data, True)

if data != "":
	system.perspective.download('track_trace_history.csv', csv)
else:
	system.perspective.openPopup('errorModal', 'StyleGuide/Modals/ErrorModal', params={'errorMessage': 'Please select data to generate file'})

config.expression:
runScript("mes.trace.sp.getFullPartHistory", 0, 
	if({view.params.partId} = "" || {view.params.partId} = "None", None, {view.params.partId}), 
	if({view.params.label} = "" || {view.params.label} = "None", None, {view.params.label}), 
	if({view.params.startTime} = "None", None, {view.params.startTime}),
	if({view.params.endTime} = "None", None, {view.params.endTime})
)
